import React, {useState} from 'react';
import Item from "./Item";
import axios from "axios";

const ProductCollection = () => {
  const [data, setData] = useState([]);
  const [done, setDone] = useState(false);

  const getJsonData =
      async (setData) =>  {
          console.log('clck');
        await axios.get('https://homework.solutional.ee/api/products')
            .then(response => {
              console.log(response.data);
              setData(response.data);
            })
            .catch(err => {
              console.log(err);
            })
      }

  return (
      <div className="App">
        {data.length
            ? data.map(item => <Item key={item.id} item={item} />)
            : 'Collection is empty'
        }
        <button onClick={() => getJsonData}>Get Collection</button>
        <button onClick={() => setData([])}>Clear Collection</button>
      </div>
  );
}

export default ProductCollection;
